import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import './Chatbot.css';

const BACKEND_WEBHOOK_URL = 'http://localhost:3000/api/webhook';

const Chatbot = () => {
  const [messages, setMessages] = useState([]);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);
  const messagesEndRef = useRef(null);

  useEffect(() => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages]);

  useEffect(() => {
    setMessages([
      {
        id: 1,
        text: 'Hello! Welcome to Meesho Shopping Assistant. How can I help you today?',
        sender: 'bot',
        timestamp: new Date(),
      },
    ]);
  }, []);

  const sendMessage = async (textToSend = message) => {
    if (textToSend.trim() === '') return;

    const userMessage = {
      id: Date.now(),
      text: textToSend,
      sender: 'user',
      timestamp: new Date(),
    };

    setMessages((prev) => [...prev, userMessage]);
    setMessage('');
    setLoading(true);

    try {
      const response = await axios.post(BACKEND_WEBHOOK_URL, {
        queryResult: { queryText: textToSend }
      });

      const botResponseData = response.data;
      let botMessageText = 'I am not sure how to respond to that.';

      if (botResponseData && botResponseData.fulfillmentText) {
        botMessageText = botResponseData.fulfillmentText;
      }

      const botMessage = {
        id: Date.now() + 1,
        text: botMessageText,
        sender: 'bot',
        timestamp: new Date(),
      };

      setMessages((prev) => [...prev, botMessage]);
    } catch (error) {
      console.error('Error sending message:', error);
      const errorMessage = {
        id: Date.now() + 1,
        text: 'Sorry, I could not connect to the server. Please make sure the backend is running.',
        sender: 'bot',
        timestamp: new Date(),
        isError: true,
      };
      setMessages((prev) => [...prev, errorMessage]);
    }

    setLoading(false);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      sendMessage();
    }
  };

  const quickReplies = ['Find products', 'Track my order', 'Get recommendations'];

  const handleQuickReply = (reply) => {
    sendMessage(reply);
  };

  return (
    <div className="chat-container">
      <div className="chat-header">
        <h1>üõçÔ∏è Shopping Assistant</h1>
      </div>

      <div className="messages-container">
        {messages.map((msg) => (
          <div key={msg.id} className={`message ${msg.sender}`}>
            <div className={`message-content ${msg.isError ? 'error' : ''}`}>
              {msg.text}
            </div>
          </div>
        ))}

        {loading && (
          <div className="message bot">
            <div className="message-content">
              <div className="typing-indicator">
                <span></span>
                <span></span>
                <span></span>
              </div>
            </div>
          </div>
        )}
        
        <div ref={messagesEndRef} />
      </div>

      {messages.length > 0 && messages[messages.length - 1].sender === 'bot' && !loading && (
        <div className="quick-replies">
          {quickReplies.map((reply, index) => (
            <button
              key={index}
              onClick={() => handleQuickReply(reply)}
              className="quick-reply-btn"
            >
              {reply}
            </button>
          ))}
        </div>
      )}

      <div className="input-container">
        <input
          type="text"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          onKeyPress={handleKeyPress}
          placeholder="Type your message here..."
          disabled={loading}
        />
        <button onClick={() => sendMessage()} disabled={loading || !message.trim()}>
          {loading ? '...' : 'Send'}
        </button>
      </div>
    </div>
  );
};

export default Chatbot;
